import { motion } from 'framer-motion'

export default function About() {
    return (
    <motion.div 
        animate={{ x: 100 }}
        transition={{ type: "spring", stiffness: 100 }}
        exit={{ opacity: 0 }} 
        id="about-content" 
        className="content">
        ABOUT
    </motion.div> 
  )
}
